import { BrowserWindow } from "electron";
import { readFileSync } from "fs";

export const openFile = (filePath:string,window:BrowserWindow) =>{
    const fileContent = readFileSync(filePath, 'utf-8')
    window.webContents.send(, {
      filePath,
      fileContent
    })
}
